import React from "react";
import styled from 'styled-components';

const Navbar = () => {

  return <>
    <Nav>
      <h1>Park Games</h1>
      <div>
        <h2>Home</h2>
        <h2>Sign Up</h2>
        <h2>Login</h2>
      </div>


    </Nav>

  </>

}

export default Navbar;

const Nav = styled.nav`
background: white;

h1 {
  text-align: center;
}
h2 {
  text-align: center;
}
div{
  display: flex;
  justify-content: space-between;
}



`
